import "./App.css";

function App() {
  return (
    <div className="geral">
        <div className="header">

            <div className="logo"></div>
            <div className="menu"></div>

        </div>

        <div className="body">

            <div className="book">

                <div className="feed"></div>
                <div className="user"></div>
                <div className="bichinho"></div>

            </div>
   
        </div>

    </div>
    
  );
}

export default App;
